import React from "react";
import {Container} from "react-bootstrap";
import Footer from "./components/Footer";
import Hero from "./components/Hero";
import PortfolioCard from "./components/PortfolioCard";

const App = () => (
  <div>
    <Hero
      ImageLink="https://techcrunch.com/wp-content/uploads/2019/10/Instagram-On-This-Day.jpeg?w=1390&crop=1"
      ResumeLink="https://docs.google.com/document/d/1XIvk-T98zqfuaIrmZrlrgaQPrGrVnzdDCN676ZQy1Qs/edit"
    />
    <Container>
      <PortfolioCard 
      ImageLink="https://via.placeholder.com/720x250"
      ImageAlt="Description"
      />
      <PortfolioCard />
      <PortfolioCard />
      <PortfolioCard />
    </Container>
  </div>
);

export default App;
